import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import Home from "./Home";

function App() {
  return (
    <div>
        <Router>
          <Switch>
            <Route exact to='/' component={Home}></Route>
          </Switch>
        </Router>
    </div>
  );
}

export default App;
